import React from 'react';

const LoginPage = () => {
  return (
    <div>
      <h2>Login</h2>
      <form>
        <label>Username : <input type="text"/> </label><br></br><br></br>
        <label>Password : <input type="password" /></label><br></br><br></br>
        <button type="submit">Login</button>
      </form>
    </div>
  );
};

export default LoginPage;
